    <style>.Modal {
        direction: rtl;
        position: absolute;
        left: 0;
        top: 0;
        width: 100%;
        height: 100%;
        z-index: 5000;
        display: flex;
        flex-direction: column;
        padding: 30px;
        transition: all .2s ease-in-out;
    }

    .Modal:not(.pre-show) {
        display: none;
    }

    .Modal.show {
        background-color: rgba(0, 0, 0, 0.5);
    }

    .Modal-body {
        background-color: white;
        margin: auto;
        width: 100%;
        border-radius: 10px;
        display: flex;
        flex-direction: column;
        transform: scale(0.7);
        opacity: 0;
        transition: all .4s cubic-bezier(.07, .92, .34, 1.22);
        position: relative;
        overflow: hidden;
    }

    .Modal.small .Modal-body {
        max-width: 300px;
    }

    .Modal.medium .Modal-body {
        max-width: 600px;
    }

    .Modal.large .Modal-body {
        max-width: 1000px;
    }

    .Modal.wide .Modal-body {
        max-width: unset;
    }

    .Modal.show .Modal-body {
        transform: scale(1);
        opacity: 1;
    }

    .Modal-content {
        flex: 1 1;
        padding: 0 15px;
        overflow: auto;
        position: relative;
    }

    .Modal.loading .Modal-content:after {
        content: '';
        background-color: white;
        opacity: 0.5;
        width: 100%;
        height: 100%;
        position: fixed;
        left: 0;
        top: 0;
    }

    .Modal-header {
        padding: 0 15px 15px;
        box-shadow: 0 0 10px -7px gray;
    }

    .Modal-title {
        font-size: 15px;
        font-weight: 500;
        line-height: 20px;
        color: #555;
        padding-top: 15px;
    }

    .Modal-description {
        font-size: 12px;
        font-weight: 300;
        color: #666;
        padding-top: 5px;
    }

    .Modal-content {
        padding: 10px;
    }

    .Modal-controls {
        /*flex: 1;*/
        min-height: 20px;
        padding: 6px;
        display: flex;
        flex-wrap: wrap;
        justify-content: flex-end;
    }

    .Modal-shadow {
        box-shadow: 0 0 10px -7px gray;
        z-index: 2;
    }

    .Modal-error {
        font-size: 13px;
        flex: 1 1;
        color: var(--fos-red);
        line-height: 20px;
        padding: 5px;
        margin: auto;
    }

    .Modal-loading {
        background-position: right;
        background-size: 20px;
        background-repeat: no-repeat;
        line-height: 20px;
        margin: auto 10px;
        padding-right: 25px;
        font-size: 13px;
        min-height: 20px;
    }

    .Modal.shake .Modal-body {
        animation-timing-function: ease-in-out;
        animation-name: pulse;
        animation-duration: 0.5s;
    }

    @keyframes pulse {
        0% {
            transform: scaleX(1)
        }
        50% {
            transform: scale3d(0.97, 0.97, 0.97)
        }
        to {
            transform: scaleX(1)
        }
    }

    @keyframes tada {
        0% {
            transform: scaleX(1)
        }
        10%, 20% {
            transform: scale3d(.9, .9, .9) rotate(-3deg)
        }
        30%, 50%, 70%, 90% {
            transform: scale3d(1.1, 1.1, 1.1) rotate(3deg)
        }
        40%, 60%, 80% {
            transform: scale3d(1.1, 1.1, 1.1) rotate(-3deg)
        }
        to {
            transform: scaleX(1)
        }
    }

    @keyframes shake {
        0% {
            transform: translateX(0)
        }
        6.5% {
            transform: translateX(-6px) rotateY(-9deg)
        }
        18.5% {
            transform: translateX(5px) rotateY(7deg)
        }
        31.5% {
            transform: translateX(-3px) rotateY(-5deg)
        }
        43.5% {
            transform: translateX(2px) rotateY(3deg)
        }
        50% {
            transform: translateX(0)
        }

    <style>.Button {
        font-size: 25px;
        line-height: 40px;
        display: flex;
        flex-direction: row;
        justify-content: center;
        padding: 10px 20px;
        cursor: pointer;
        border-radius: 5px;
        background-color: #e7e7e7;
        direction: rtl;
    }

    .Button:disabled {
        cursor: default;
        opacity: 0.5;
    }

    .Button div {
        margin: auto;
    }

    .Button.red {
        color: white;
        background-color: var(--goo-red);
    }

    .Button.yellow {
        color: #555;
        background-color: var(--goo-yel);
    }

    .Button.green {
        color: white;
        background-color: var(--goo-gre);
    }

    .Button.blue {
        color: white;
        background-color: var(--goo-blu);
    }

    .Button-icon {
        display: block;
        width: 40px;
        height: 40px;
        padding: 5px;
    }

    .Button-loader {
        width: 40px;
        height: 40px;
        margin-left: 10px;
        padding: 5px;
    }

    <style>.Input {
        direction: rtl;
        width: 100%;
        border-radius: 5px;
        cursor: text;
    }

    .Input.read-only {
        opacity: 0.7;
        cursor: not-allowed;
    }

    .Input-label {
        padding: 0 10px;
        line-height: 20px;
        display: block;
        white-space: nowrap;
        text-overflow: ellipsis;
        overflow: hidden;
        cursor: inherit;
        font-size: 12px;
    }

    .Input-control {
        font-weight: 500;
        line-height: 50px;
        width: 100%;
        border: solid 1px #e9e9e9;
        border-radius: 5px;
        padding: 0 10px;
        font-size: 20px;
        color: #555;
        /*transition: all 0.2s ease-in-out;*/
        background-color: white;
        cursor: inherit;
    }

    .Input.disabled .Input-control {
        opacity: 0.8;
        cursor: not-allowed;
        background-color: #e9e9e9;
    }

    .Input-control:focus {
        outline: none;
        box-shadow: 0 0 0 3px rgba(33, 150, 243, 0.2);
        border-color: rgba(33, 150, 243, 0.2);
    }

    .Input.right .Input-control {
        text-align: right;
    }

    .Input.center .Input-control {
        text-align: center;
    }

    .Input.left .Input-control {
        text-align: left;
    }

    .Input.error .Input-control {
        /*border-color: var(--goo-red);*/
        background-color: var(--goo-red-l);
    }

    .Input.error .Input-control:focus {
        outline: none;
        box-shadow: 0 0 0 3px rgba(234, 67, 53, 0.2);
        border-color: rgba(234, 67, 53, 0.2);
    }

    .Input-error {
        font-size: 12px;
        color: var(--goo-red);
        line-height: 15px;

    <style>#notification-root {
        position: fixed;
        left: 50%;
        bottom: 0;
        /* max-width: 500px; */
        direction: rtl;
        z-index: 5000;
        transform: translateX(-50%);
    }

    .Notif {
        width: -moz-fit-content;
        width: fit-content;
        background-color: white;
        padding: 15px;
        margin: 10px auto 10px;
        border-radius: 7px;
        box-shadow: 0 0 10px -5px gray;
        font-size: 25px;
        color: #555;
        position: relative;
        overflow: hidden;
        /*opacity: 0;*/
        transform: translateY(110%);
        transition: all 0.3s ease-in-out;
        display: flex;
        flex-direction: row;
        cursor: pointer;
    }

    .Notif.show {
        /*opacity: 1;*/
        transform: translateY(0);
    }

    .Notif-icon {
        width: 20px;
        height: 20px;
        position: absolute;
        right: 0;
        top: 0;
        margin: 15px;
    }

    .Notif-content {
        line-height: 40px;
    }

    .Notif.icon .Notif-content:before {
        content: 'بب ';
        color: white;
    }

    .Notif .timer {
        position: absolute;
        left: 0;
        bottom: 0;
        width: 50%;
        height: 4px;
        border-radius: 1px;
        background-color: #6cb2eb;
    }

    .Notif.error .timer {
        background-color: var(--goo-red);
    }

    .Notif.prompt .timer {
        background-color: var(--goo-gre);
    }

    .Notif.show .timer {
        animation-name: timer;
        animation-fill-mode: forwards;
        animation-timing-function: linear;
    }

    .Notif:hover .timer {
        animation-play-state: paused;
    }

    @keyframes timer {
        from {
            width: 0;
        }
        to {
            width: 100%;
        }
    }
